import React from "react";

export default function Files(props) {
    const displayFiles = (props) => {
        const uploads = props.uploads;

        if (uploads.length > 0) {
            return (
                <table>
                    <tr>
                        <th>File Name</th>
                        <th>Detection Type</th>
                    </tr>
                    {uploads.map(upload => (
                    <tr key={upload._id}>
                        <td>{upload.fileName}</td>
                        <td>{upload.textDetection}</td>
                    </tr>
                    ))}
                </table>
            )
        }
    }

    return (
        <div>
            <h2>Library</h2>
            {displayFiles(props)}
        </div>
    );
}
